import { Form,Formik,Field } from "formik"

export function PostForm() {
  return (
    <div>Formulario

      <Formik
        initialValues={{
          title: '',
          description:''
        }}
      >
        <Form>
          <Field name='title' placeholder="title"/>
          <Field name='description' placeholder="description"/>
        </Form>
      </Formik>

    </div>
  )
}
